import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Home from "./componentes/paginas/Home/home";
import Graficos from "./componentes/paginas/Graficos/graficos";
import Votacao from "./componentes/paginas/Votacao/votacao";


function App() {
  return (
    <Router>
      <div>
        {/*BARRA DE NAVEGAÇÃO AQUI*/}

        <Switch>
          <Route path="./componentes/paginas/home/" exact Component={Home}/>
          <Route path="/" exact Component={Home}/>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
